import React, { useRef, useState, useEffect } from 'react'
import Quill from 'quill'

const IndexPage = () => {
  function focusEditor() {
    editor.current.focus()
  }

  useEffect(() => {}, [])

  const quill = new Quill('#editor', {
    theme: 'snow'
  })
  return <div>{quill}</div>
}

export default IndexPage
